  false,\n\t\"url\": null,\n\t\"notes\": \"Circulation figures include new checkouts
  as well as renewals. The Chicago Public Library opened four new locations in 2011:
  Greater Grand Crossing (4/23/11); Dunning (5/6/11); Daley, Richard M.-W Humboldt
  (7/8/11) and Little Village (10/3/11). Edgewater closed 6/16/11 for construction
  of a new branch; a bookmobile for holds pickup and returns opened 6/24/11. Altgeld
  closed for extended periods in July and August for air conditioning installation.
  Back of the Yards closed permanently 8/22/11 due to repeated flooding. All locations
  were closed February 2-February 3 due to weather. In addition, many locations experienced
  sporadic closures in summer 2011 due to weather-related issues.\",\n\t\"license_title\":
